titles:
Measurement of |V_{ub}/V_{cb}| (and |V_{ub}|) in Exclusive Nonleptonic
  Decays, \bar{B}^0 --> D_s^{(*)-}(π^+,ρ^+) and \bar{B}^0 -->
  D_s^{(*)-}D^{(*)+}

Measurement of the ratio of inclusive cross sections $σ(p\bar{p}
  \rightarrow Z+2~b \text{jets}) / σ(p\bar{p} \rightarrow Z+ \text{2
  jets})$ in $p\bar{p}$ collisions at $\sqrt s=1.96$ TeV
